import Layout from '../components/layout/primaryLayout';
import Link from 'next/link';
import { sizing } from '@material-ui/system';
import { Grid, Typography, Button, Container } from '@material-ui/core';

const Home = () => {
	return (
		<Layout>
			<Grid container justify="center" alignContent="center" alignItems="center" height="100vh">
				<Container>
					<Typography align="center">
						Call For Help
					</Typography>
					<Link passHref prefetch href="/ic">
						<Button spacing={2} variant="contained" color="primary">IC</Button>
					</Link>
					<Link passHref prefetch href="/maintenance">
						<Button variant="contained" color="primary">Maintenance</Button>
					</Link>
				</Container>
			</Grid>
		</Layout>
	)
}

export default Home
